		"Fm",
		"Md",
		"No",
	];
	let inputVal = "";

	const breakDownInput = () => {
		let res = [];
		isOkay(elements, inputVal, "", res);
		return res.reverse();
	}

	const isOkay = (/** @type {string | any[]} */ elements, /** @type {string} */ input, /** @type {string} */ candidate, /** @type {any[] | undefined} */ res) => {
		for (let i = 0; i < elements.length; i++) {
			let testee = (candidate + elements[i]).toLowerCase();
			if (testee.toLowerCase() === input.toLowerCase()) {
				res?.push(elements[i]);
				return true;
			}
			if(input.toLowerCase().startsWith(testee.toLowerCase())){
				let tempRes = isOkay(elements, input.toLowerCase(), testee.toLowerCase(), res);
				if (tempRes) {
					res?.push(elements[i]);
					return true;
				}
			}
			testee = candidate.toLowerCase();
		}
		return false;
	}

	const onKeyPress = (/** @type {{ charCode: number; } | string} */ e) => {
		// @ts-ignore
		if (e.charCode === 13 || e === "button_pressed"){
			let result = breakDownInput();
			console.log(result);
			if (result.length != 0) {

				let timeLine = anime.timeline({
					easing: 'easeInOutSine',
					autoplay: true,
				});

				for (let i = 0; i < result.length; i++) {
					timeLine.add({
						targets: '#' + result[i],
						opacity: [1, 1],
						translateY: 100,
						duration: 250
					})
				}

			}
		}
	}
</script>

